[{'chunk_id': 'chunk_00015', 'path': 'got\download.go', 'text': 'func (d *Download) dl(dest io.WriterAt, errC chan error) {

	var (
		// Wait group.
		wg sync.WaitGroup

		// Concurrency limit.
		max = make(chan int, d.Concurrency)
	)

	for i := 0; i < len(d.chunks); i++ {

		max <- 1
		wg.Add(1)

		go func(i int) {
			defer wg.Done()

			// Concurrently download and write chunk
			if err := d.DownloadChunk(d.chunks[i], &OffsetWriter{dest, int64(d.chunks[i].Start)}); err != nil {
				errC <- err
				return
			}

			<-max
		}(i)
	}

	wg.Wait()
	errC <- nil
}

